const pooltimeFlattened = pooltime.reduce((acc, entry) => {
    const { v: vault, p: winner, t: tier, i: indices } = entry;
    indices.forEach((prizeIndex) => {
        acc.push({ vault, winner, tier, prizeIndex });
    });
    return acc;
}, []);

const differences = [];

cabana.forEach((entry) => {
    const { vault, winner, tier, prizeIndex } = entry;
    const match = pooltimeFlattened.find(
        (pt) => pt.vault === vault && pt.winner === winner && pt.tier === tier && pt.prizeIndex === prizeIndex
    );

    if (!match) {
        differences.push(entry);
    }
});

if(differences.length === 0) {console.log("apis match")}else{
console.log("Differences:", differences);}
